Defendant Jose M Navarro in court with attorney Jamie Francis Cimpl-Wiemer.  Nathaniel E Adamson for Hanna Kolberg appeared for the State of Wisconsin.  
Statements made as to sentencing.  
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 3 YEARS, with credit for 14 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 18 MONTHS, same terms and conditions as probation to apply.  The defendant is eligible for the Challenge Incarceration Program and is eligible for the "Wisconsin Substance Abuse Program".

The Court STAYED this sentence and placed the defendant on probation for a period of 2 YEARS with the following conditions:  
*Serve 90 DAYS in the House of Correction with huber release for work, childcare, and medical/dental appointments (REPORT DATE: 11/10/15); 
*No firearms;
*No drugs or alcohol;
*No new offenses that rise to the level of probable cause;
*Follow through with all programming deemed appropriate by agent;
Defendant shall provide a DNA sample for the Data Bank and pay all appropriate costs.  Amount to be decucted from any bail on deposit.  Remaining balance if applicable to be paid by 2.3.16, or, if not paid, a civil judgment is ordered.
Court ordered defendant to pay all applicable court costs and surcharges.  Amount to be decucted from any bail on deposit.  Remaining balance if applicable to be paid by 2.3.16, or, if not paid, a civil judgment is ordered.
Court advised defendant that as a convicted felon he may never possess a firearm or body armor.  Court advised defendant that his voting rights are suspended and he may not vote in any election until his civil rights are restored. 

